function init()
{
	container = document.getElementById('container');

	scene = new THREE.Scene();

	renderer = new THREE.WebGLRenderer();
	renderer.setPixelRatio(window.devicePixelRatio);
	renderer.setSize(window.innerWidth, window.innerHeight);

	light = new THREE.DirectionalLight(0xffffff);
	scene.add(light);

	var textureLoader = new THREE.TextureLoader();

	textureImage = textureLoader.load("./5.jpg", function(textureImage) {

		var h = textureImage.image.height / textureImage.image.width;
		var aspect = window.innerHeight / window.innerWidth;

		var widthDelta = Math.max(1.0, h / aspect);
		var heightDelta = Math.max(aspect, h);

		camera = new THREE.OrthographicCamera((1.0 - widthDelta) / 2.0, (1.0 + widthDelta) / 2.0, (heightDelta + h) / 2.0, (heightDelta - h) / 2.0, -1, 1);
		cameraOrthoHelper = new THREE.CameraHelper(camera);

		var material = new THREE.MeshBasicMaterial({ map: textureImage });

		geometry = new THREE.Geometry();

		geometry.dynamic = true;

		for (var i = 0, il = vertices.length; i < il; i++) {
			geometry.vertices.push(new THREE.Vector3(vertices[i][0], h * vertices[i][1], 0.0));
		}

		for (var i = 0, il = faces.length; i < il; i++) {
			geometry.faces.push(new THREE.Face3(faces[i][0], faces[i][1], faces[i][2]));
			geometry.faceVertexUvs[0].push([texcoords[faces[i][0]],
			                               texcoords[faces[i][1]],
			                               texcoords[faces[i][2]]]);
		}

		geometry.computeFaceNormals();

		var mesh = new THREE.Mesh(geometry, material);

		scene.add(mesh);

		animate();
	});

	textureImage.needsUpdate = true;
	textureImage.magFilter = THREE.NearestFilter;
	textureImage.repeat.set(1.0, 1.0);
	textureImage.wrapS = textureImage.wrapT = THREE.RepeatWrapping;
	textureImage.anisotropy = 16;

	container.innerHTML = "";

	container.appendChild(renderer.domElement);

	window.addEventListener('resize', onWindowResize, false);
}

function onWindowResize()
{
	var h = textureImage.image.height / textureImage.image.width;
	var aspect = window.innerHeight / window.innerWidth;

	var widthDelta = Math.max(1.0, h / aspect);
	var heightDelta = Math.max(aspect, h);

	camera = new THREE.OrthographicCamera((1.0 - widthDelta) / 2.0, (1.0 + widthDelta) / 2.0, (heightDelta + h) / 2.0, (heightDelta - h) / 2.0, -1, 1);
	cameraOrthoHelper = new THREE.CameraHelper(camera);
	camera.updateProjectionMatrix();

	renderer.setSize(window.innerWidth, window.innerHeight);
}

function animate()
{
	requestAnimationFrame(animate);

	frame += 1;

	if (frame >= tests.length) {
		frame = 0;
	}

	var vv = tests[frame];

	for (var i = 0, il = geometry.vertices.length; i < il; i++) {

		var pt = vv[i];

		geometry.vertices[i].x = pt[0];
		geometry.vertices[i].y = textureImage.image.height / textureImage.image.width * pt[1];
	}

	geometry.verticesNeedUpdate = true;

	// light.position.set(camera.position.x, camera.position.y, camera.position.z).normalize();
	renderer.render(scene, camera);
}

init();
